create table employees (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	title VARCHAR(50),
	gender VARCHAR(50),
	job_title VARCHAR(50),
	email VARCHAR(50),
	ssn VARCHAR(50),
	phone_number VARCHAR(50),
	street VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50),
	country VARCHAR(50),
	zip VARCHAR(50),
	department INT,
	office INT
);
